import React from 'react';
import Appbar from './Appbar'
import Business from "./Businesses"
import  { useState, useEffect } from "react";
import Provison from "./Provision/FormandAnalysis"
import { BrowserRouter as R, Switch as S, Route, Link } from "react-router-dom";
import './App.css';

function App() {
  const [t, st] = React.useState("Massaquoi Royal");
  const [dt,setD] = useState({i:[ ],s:[ ]})
  const f=(v)=>{
    st(v)
  }
  return (
    <div className="App"> 
    <Appbar t={t}/>
      <R>
        <Route component={Business} exact path="/" />  
        <Route exact path="/provision" render={(props) => <Provison {...props} d={dt} sd={setD} f={f} />} />  
      </R>


    </div>
  );
}

export default App;
